import json
import csv
from io import StringIO

def map_reputation_to_severity(reputation):
    try:
        reputation = int(reputation)
        severity_map = {
            0: 'Low',
            1: 'Medium',
            2: 'High'
        }
        return severity_map.get(reputation, 'Low')  # Default to 'Low' if not in map
    except (ValueError, TypeError):
        return 'Low'  # Default to 'Low' for any invalid values

def main(json_input):
    try:
        # Extract JSON string if wrapped in dictionary
        if isinstance(json_input, dict) and 'json_input' in json_input:
            json_input = json_input['json_input']

        # Parse JSON string if needed
        if isinstance(json_input, str):
            if not json_input.strip():
                return {"error": "Empty input received"}
            data = json.loads(json_input)
        else:
            data = json_input

        # Ensure data is a list
        if not isinstance(data, list):
            data = [data]

        # Define fields to extract (removed 'category' and 'discoveringEntryId')
        fields = ['type', 'ioc', 'reputation']
        # Define display names for headers
        header_display = {
            'type': 'Type',
            'ioc': 'IoC',
            'reputation': 'Severity'
        }

        # Initialize results
        html_result = None
        csv_result = None

        # Generate HTML table
        html_table = []
        html_table.append('<table style="width: 100%; border-collapse: collapse; margin-top: 10px; font-family: Arial, sans-serif;">')

        # Add header row
        html_table.append('<thead>')
        html_table.append('<tr style="background-color: #f8f8f8;">')
        for field in fields:
            html_table.append(f'<th style="padding: 10px; border: 1px solid #ddd; text-align: left;">{header_display[field]}</th>')
        html_table.append('</tr>')
        html_table.append('</thead>')

        # Create CSV buffer
        csv_output = StringIO()
        csv_writer = csv.writer(csv_output, quoting=csv.QUOTE_MINIMAL)
        # Write headers with display names
        csv_writer.writerow([header_display[field] for field in fields])

        # Process data rows for both formats
        html_table.append('<tbody>')
        rows_written = 0

        for item in data:
            if not isinstance(item, dict):
                continue

            # Process row for HTML
            html_table.append('<tr>')
            row_data = []

            for field in fields:
                value = item.get(field, '')
                if value is None:
                    value = ''
                elif field == 'reputation':
                    value = map_reputation_to_severity(value)
                elif isinstance(value, (bool, int, float)):
                    value = str(value)

                # Add to CSV row
                row_data.append(value)

                # Add to HTML with special styling for severity
                if field == 'reputation':
                    severity_colors = {
                        'Low': '#2C9469',    # Green
                        'Medium': '#FF9800',  # Orange
                        'High': '#FF4444'     # Red
                    }
                    color = severity_colors.get(value, '#2C9469')
                    html_table.append(f'<td style="padding: 10px; border: 1px solid #ddd; color: {color}; font-weight: bold;">{value}</td>')
                else:
                    html_table.append(f'<td style="padding: 10px; border: 1px solid #ddd;">{value}</td>')

            html_table.append('</tr>')
            csv_writer.writerow(row_data)
            rows_written += 1

        html_table.append('</tbody>')
        html_table.append('</table>')

        if rows_written == 0:
            return {"error": "No valid data rows found to process"}

        # Finalize HTML table
        html_result = '\n'.join(html_table)

        # Get raw CSV string
        csv_result = csv_output.getvalue()

        return {
            "table": html_result,
            "csv": csv_result
        }

    except json.JSONDecodeError as e:
        return {"error": f"Error parsing JSON: {str(e)}"}
    except Exception as e:
        return {"error": str(e)}

if __name__ == "__main__":
    result = main(json_input)
    print(result)
